import "./ExpenseDate.css"

function ExpanseDate(props) {

    const month = props.date.toLocaleString("cs-cz", {month: "long"});
    const year = props.date.toLocaleString("cs-cz", {day: "2-digit"});
    const day = props.date.getFullYear();

    return (
        <div className="expanse-date">
            <div className="expanse-date__month">{month}</div>
            <div className="expanse-date__year">{year}</div>
            <div className="expanse-date__day">{day}</div>
        </div>
    );
    
}

export default ExpanseDate;
